export class BirthdayCake extends Component {
  render() {
    return (
      <section>
        <div className="container">
          <h2>BirthdayCake</h2>
          {/* <h3>FORM</h3>
            <h4>-1- dropdown -- -cakesize- [1/2Kg or 1kg]-</h4>
